        <div class="text-wrapper"><p>Central Life Sciences offers a multitude of premise control options that can be used throughout any agricultural operation or rural living environment to fight a variety of insects. We have fly control products that can go on cattle and crops, as well as around barns, stables and out buildings. We have fire ant baits designed for pastures and around the property as well as mosquito control products made for standing water and around the backyard.</p></div>
